// src/components/Skills.js
import React from "react";
import "./Skills.css";

import {
  FaHtml5, FaCss3Alt, FaJs, FaPython, FaJava, FaReact, FaNodeJs,
  FaAws, FaGitAlt, FaGithub, FaAndroid, FaFigma
} from "react-icons/fa";

import {
  SiExpress, SiMongodb, SiPostman, SiCanva, SiDart, SiNumpy,
  SiPandas, SiTensorflow, SiMysql
} from "react-icons/si";

import { TbBrain } from "react-icons/tb";
import { AiOutlineEye } from "react-icons/ai";

const skills = [
  { name: "HTML5", icon: <FaHtml5 /> },
  { name: "CSS3", icon: <FaCss3Alt /> },
  { name: "JavaScript", icon: <FaJs /> },
  { name: "Python", icon: <FaPython /> },
  { name: "Java", icon: <FaJava /> },
  { name: "React", icon: <FaReact /> },
  { name: "Node.js", icon: <FaNodeJs /> },
  { name: "Express.js", icon: <SiExpress /> },
  { name: "MongoDB", icon: <SiMongodb /> },
  { name: "MySQL", icon: <SiMysql /> },
  { name: "Git", icon: <FaGitAlt /> },
  { name: "GitHub", icon: <FaGithub /> },
  { name: "AWS", icon: <FaAws /> },
  { name: "Postman", icon: <SiPostman /> },
  { name: "Android", icon: <FaAndroid /> },
  { name: "Figma", icon: <FaFigma /> },
  { name: "Canva", icon: <SiCanva /> },
  { name: "Dart", icon: <SiDart /> },
  { name: "NumPy", icon: <SiNumpy /> },
  { name: "Pandas", icon: <SiPandas /> },
  { name: "TensorFlow", icon: <SiTensorflow /> },
  { name: "Machine Learning", icon: <TbBrain /> },
  { name: "Computer Vision", icon: <AiOutlineEye /> },
];

const Skills = () => {
  return (
    <section className="skills-section">
      <h2 className="section-title">My Skills</h2>
      <div className="skills-grid">
        {skills.map((skill, index) => (
          <div className="skill-card" key={index}>
            <div className="skill-icon">{skill.icon}</div>
            <div className="skill-name">{skill.name}</div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
